<h3>功能介绍</h3>
<ul>
<li><strong>实时语音转文字与实时翻译</strong>：需要麦克风权限</li>
<li><strong>音频、视频文件导入</strong>：支持的文件格式包括 mp3、wav、m4a、ogg、mp4、webm、ogm</li>
